import React from "react";
import styled from "styled-components";
import ImageSliderContents from "./imageSliderContents/ImageSliderContents";

const ImageSliderContainer = styled.section`
  height: 60vh;
  width: 100vw;
  position: relative;
  /* overflow: hidden; */
  display: flex;

  /* 임시 */
  overflow: scroll;

  img {
    width: 100%;
  }
`;

const ImageSlider = () => {
  return (
    <ImageSliderContainer>
      <ImageSliderContents />
    </ImageSliderContainer>
  );
};

export default ImageSlider;
